import React from 'react';
import {AuthHeader, ContentLayout} from "@shared/ui";

export const RegistrationPage = () => {
    return (
        <ContentLayout center>
            <AuthHeader>
                Добро пожаловать!
                <br/>
                <span>Пройдите регистрацию для доступа к сервису</span>
            </AuthHeader>


        </ContentLayout>
    );
};
